/* Show Password */
function ShowPass() {
    var x = document.getElementById("passId");
    if (x.type === "password") {
        x.type = "text";
    } else {
        x.type = "password";
    }
    var y = document.getElementById("passId2");
    if (y.type === "password") {
        y.type = "text";
    } else {
        y.type = "password";
    }
}

